import React from 'react';

const Login = () => {
    return (
            <div className="container">
                <form action="Login">
                    <div className="form-group">
                        <label for="nome">Nome</label>
                        <input type="text" className="form-control" id="nome" />
                    </div>
                </form>
            </div>
    )
}

export default Login;
